/*Table structure for table `house` */

DROP TABLE IF EXISTS `house`;

CREATE TABLE `house` (
  `id` int(11) unsigned NOT NULL,
  `title` varchar(100) DEFAULT NULL,
  `type` varchar(20) DEFAULT NULL COMMENT '类型.(多个用逗号隔开)1:单间,2:标间套一,3:整租',
  `img` varchar(100) DEFAULT NULL COMMENT '封面图片',
  `house_type_img` varchar(100) DEFAULT NULL COMMENT '户型图',
  `address` varchar(100) DEFAULT NULL COMMENT '具体地址',
  `area_id` int(6) DEFAULT NULL COMMENT '关联生活区',
  `status` tinyint(2) DEFAULT NULL COMMENT '状态:-1下架  1激活',
  `lng` varchar(10) DEFAULT NULL COMMENT '经度',
  `lat` varchar(10) DEFAULT NULL COMMENT '纬度',
  `business` varchar(30) DEFAULT NULL COMMENT '附近商圈',
  `crowd` varchar(30) DEFAULT NULL COMMENT '人群',
  `train` varchar(30) DEFAULT NULL COMMENT '地铁',
  `bus` varchar(30) DEFAULT NULL COMMENT '公交',
  `market` varchar(30) DEFAULT NULL COMMENT '超市',
  `food_market` varchar(30) DEFAULT NULL COMMENT '菜市',
  `bank` varchar(30) DEFAULT NULL COMMENT '银行',
  `restaurant` varchar(30) DEFAULT NULL COMMENT '餐馆',
  `hospital` varchar(30) DEFAULT NULL COMMENT '医院'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='租房表';

