/*Table structure for table `room` */

DROP TABLE IF EXISTS `room`;

CREATE TABLE `room` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL,
  `house_id` int(11) DEFAULT NULL COMMENT '对应houseid',
  `price` int(5) unsigned DEFAULT NULL COMMENT '每月价钱',
  `size` varchar(10) DEFAULT NULL COMMENT '平米',
  `img` varchar(100) DEFAULT NULL,
  `status` int(3) DEFAULT NULL COMMENT '状态:-1下架 1已入住 2未入住 3正在装修',
