/*Table structure for table `task` */

DROP TABLE IF EXISTS `task`;

CREATE TABLE `task` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(20) DEFAULT NULL COMMENT '预约人姓名',
  `mobile` varchar(15) DEFAULT NULL COMMENT '预约人电话',
  `sex` tinyint(1) unsigned DEFAULT NULL COMMENT '1:男  2女',
  `number` tinyint(1) unsigned DEFAULT NULL COMMENT '入住人数',
  `extra` varchar(500) DEFAULT NULL COMMENT '用户特殊要求',
  `house_id` int(7) DEFAULT NULL COMMENT '对应房子',
  `area_id` int(7) DEFAULT NULL COMMENT '对应地区',
  `status` tinyint(2) DEFAULT NULL COMMENT '1:待处理 2:正在处理 3处理完成 -1:暂不处理',
  `submit_time` int(11) DEFAULT NULL COMMENT '任务生成时间',
  `finish_time` int(11) DEFAULT NULL COMMENT '处理完成时间',
  `house_keeper` int(5) DEFAULT '0' COMMENT '处理人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 COMMENT='任务流';

