/*Table structure for table `task_log` */

DROP TABLE IF EXISTS `task_log`;

CREATE TABLE `task_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `task_id` int(10) unsigned NOT NULL COMMENT '任务ID',
  `type` tinyint(2) DEFAULT NULL COMMENT '类型(1:重分配管家  2:带客户看房完成  -1:暂不处理)',
  `time` int(10) unsigned DEFAULT NULL COMMENT '纪录时间',
  `user` varchar(20) DEFAULT NULL COMMENT '操作人',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='任务日志记录';

