/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nickname` varchar(18) DEFAULT NULL COMMENT '昵称',
  `mobile` char(11) DEFAULT NULL COMMENT '手机',
  `password` varchar(50) DEFAULT NULL COMMENT '密码',
  `name` varbinary(18) DEFAULT NULL COMMENT '姓名',
  `sex` tinyint(1) unsigned DEFAULT NULL COMMENT '1:男 2:女',
  `year` int(10) DEFAULT NULL COMMENT '出生年月',
  `company` varchar(50) DEFAULT NULL COMMENT '公司',
  `profession` varchar(50) DEFAULT NULL COMMENT '职业',
  `areaid` int(6) DEFAULT NULL COMMENT '生活区-对应area表',
  `email` varchar(30) DEFAULT NULL COMMENT 'email',
  `extend` varbinary(500) DEFAULT NULL COMMENT '扩展标签',
  `want_areaid` int(6) DEFAULT NULL COMMENT '期待入住-对应area表',
  `want_low_price` int(5) DEFAULT NULL COMMENT '能接受最低价钱',
  `want_high_price` int(5) DEFAULT NULL COMMENT '能接受最高价钱',
  `wangt_partner_sex` tinyint(1) unsigned DEFAULT NULL COMMENT '期待小伙伴性别',
  `status` tinyint(2) DEFAULT '1' COMMENT '-1:冻结 1:正常',
  `time` int(10) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='注册用户';

